      8742 153056995.jpg</span></td>\n<td class=\"description\">\n<p>The integrated
      circuit from an <a href=\"https://en.wikipedia.org/wiki/en:Intel\" class=\"extiw\"
      title=\"w:en:Intel\">Intel</a> 8742, a 8-bit <a href=\"https://en.wikipedia.org/wiki/en:Microcontroller\"
      class=\"extiw\" title=\"w:en:Microcontroller\">microcontroller</a> that includes
      a <a href=\"https://en.wikipedia.org/wiki/en:CPU\" class=\"extiw\" title=\"w:en:CPU\">CPU</a>
      running at 12 MHz, 128 bytes of <a href=\"https://en.wikipedia.org/wiki/en:RAM\"
      class=\"extiw\" title=\"w:en:RAM\">RAM</a>, 2048 byte of <a href=\"https://en.wikipedia.org/wiki/en:EPROM\"
      class=\"extiw\" title=\"w:en:EPROM\">EPROM</a>, and <a href=\"https://en.wikipedia.org/wiki/en:Input/output\"
      class=\"extiw\" title=\"w:en:Input/output\">I/O</a> in the same chip.\nSome
      of the <a href=\"https://en.wikipedia.org/wiki/en:Bond_wire\" class=\"extiw\"
      title=\"w:en:Bond wire\">bond wires</a> have been damaged in the process of
      opening the <a href=\"https://en.wikipedia.org/wiki/en:Electronic_packaging\"
      class=\"extiw\" title=\"w:en:Electronic packaging\">chip package</a>.\n</p>\nSee
      the <a rel=\"nofollow\" class=\"external text\" href=\"http://www.intel.com/design/archives/periphrl/docs/29025601.pdf\">official
