      />\n\t\t</gift>\n\t</owner>\n\t<title>Old processor&#039;s die</title>\n\t<description>An
      old chip that i opened to see what&#039;s inside. \n\nIt&#039;s an Intel 8742,
      a 8-bit &lt;a href=&quot;http://en.wikipedia.org/wiki/Microcontroller&quot;
      rel=&quot;noreferrer nofollow&quot;&gt;microcontroller&lt;/a&gt; that includes
      a &lt;a href=&quot;http://en.wikipedia.org/wiki/CPU&quot; rel=&quot;noreferrer
      nofollow&quot;&gt;CPU&lt;/a&gt; running at 12 MHz, 128 bytes of &lt;a href=&quot;http://en.wikipedia.org/wiki/RAM&quot;
      rel=&quot;noreferrer nofollow&quot;&gt;RAM&lt;/a&gt;, 2048 byte of &lt;a href=&quot;http://en.wikipedia.org/wiki/EPROM&quot;
      rel=&quot;noreferrer nofollow&quot;&gt;EPROM&lt;/a&gt;, and &lt;a href=&quot;http://en.wikipedia.org/wiki/Input/output&quot;
      rel=&quot;noreferrer nofollow&quot;&gt;I/O&lt;/a&gt; in the same chip.\n\nSee
      the &lt;a href=&quot;http://www.intel.com/design/archives/periphrl/docs/29025601.pdf&quot;
      rel=&quot;noreferrer nofollow&quot;&gt;official doc (pdf)&lt;/a&gt; on the intel&#039;s
      website, or see a shot of &lt;a href=&quot;http://flickr.com/photos/biwook/153062645/&quot;&gt;the
      whole thing&lt;/a&gt;.\n\nThank you to &lt;a href=&quot;http://www.flickr.com/photos/kingey1971/&quot;&gt;kingey1971&lt;/a&gt;
